import React from 'react'
import User from './User'

class App extends React.Component {
	constructor() {
		super();

		this.state = {
			name: 'Коля',
			surname: 'Иванов',
		};
	}



	render() {
		return <div>
			<User
        name={this.state.name}
        surname={this.state.surname}
      />
		</div>;
	}
}

export default App;
